import React from 'react';
import { MDBCarouselCaption, MDBCarouselItem, MDBView, MDBMask } from 'mdbreact';

class CItem extends React.Component {
    constructor(props) {
        super();
        this.itemId = {itemId: props.itemId}
        this.title = {title: props.title}
        this.src = {src: props.src}
    }

    render() {
        return (
            <MDBCarouselItem itemId={this.itemId}>
                <MDBView>
                    <img className="d-block w-100" src={this.src} alt="First slide" />
                    <MDBMask overlay="black-light" />
                </MDBView>
                <MDBCarouselCaption>
                    <h3 className="h3-responsive">{this.title}</h3>
                </MDBCarouselCaption>
            </MDBCarouselItem>
        );
    }
}

export default CItem;
